def my_func(input1: str):
    if len(input1) > 20:
        return ""

    words = input1.split(' ')
    result = []

    for word in words:
        if len(word) > 4:
            transformed_word = word[::-1]
        else:
            transformed_word = word
        result.append(transformed_word)

    return ' '.join(result)
